 import React from 'react';
 import ReactDOM from 'react-dom';
 import './index.css';
import Card from './Cards';
import Sdata from './Sdata'


 ReactDOM.render( 
     <>
     <h1 className="heading_style">list of netflix series</h1>
     {Sdata.map((val)=>{
         return(
            <Card 
    img={val.img}
    title={val.title}
    sname={val.sname}
/>
         )
     })}


</> ,
     document.getElementById('root')
 );
